import React, { useState } from "react";

const data = [
  { name: "John Doe", age: 35 },
  { name: "Jane Doe", age: 32 },
  { name: "Jim Brown", age: 40 }
];

function Barre() {
  const [filter, setFilter] = useState({ age: "" });

  const handleChange = event => {
    setFilter({ ...filter, [event.target.name]: event.target.value });
  };

  const filteredData = data.filter(item => {
    return item.age === Number(filter.age) || !filter.age;
  });

  return (
    <div>
      <form>
        <input
          type="number"
          name="age"
          value={filter.age}
          onChange={handleChange}
        />
      </form>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Age</th>
          </tr>
        </thead>
        <tbody>
          {filteredData.map(item => (
            <tr key={item.name}>
              <td>{item.name}</td>
              <td>{item.age}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Bar;
